function FilterComponent(props){
    return(
        <div className="row">
            <input
                type="text"
                className="form-control"
                id="search"
                placeholder="Buscar por Nombre, Email o palabra clave"
            />
            <label  className="form-label" htmlFor="search">
                Alumnos 
            </label>
        </div>        

    );
}

export {FilterComponent}
